import { defineMessages } from 'react-intl';

export const scope = 'app.containers.PartInfo';

export default defineMessages({
  partAddition: {
    id: `${scope}.partAddition`,
    defaultMessage: 'Part Addition',
  },
  manufacturingDetails: {
    id: `${scope}.manufacturingDetails`,
    defaultMessage: 'Manufacturing Details',
  },
  categoryDetails: {
    id: `${scope}.categoryDetails`,
    defaultMessage: 'Category Details',
  },
  partDetails: {
    id: `${scope}.partDetails`,
    defaultMessage: 'Part Details',
  },
  partMedia: {
    id: `${scope}.partMedia`,
    defaultMessage: 'Gallery',
  },
  packDetails: {
    id: `${scope}.packDetails`,
    defaultMessage: 'Pack Details',
  },
  galleryRequired: {
    id: `${scope}.galleryRequired`,
    defaultMessage: 'Gallery is required',
  },
  dragAndDropMessage: {
    id: `${scope}.dragAndDropMessage`,
    defaultMessage: 'Drag and drop a file here, or click to select file.',
  },
  dropFilesHere: {
    id: `${scope}.dropFilesHere`,
    defaultMessage: 'Drop your files here...',
  },
  saveButtonLabel: {
    id: `${scope}.saveButtonLabel`,
    defaultMessage: 'Save',
  },
  cancelButtonLabe: {
    id: `${scope}.cancelButtonLabe`,
    defaultMessage: 'Clear',
  },
  bulkUpload: {
    id: `${scope}.bulkUpload`,
    defaultMessage: 'Bulk Upload',
  },
  somethingWentWrong: {
    id: `${scope}.somethingWentWrong`,
    defaultMessage: 'Something went wrong while saving Branch Details.',
  },
  branchDetailsSaveSuccess: {
    id: `${scope}.branchDetailsSaveSuccess`,
    defaultMessage: 'Branch Details was saved successfully.',
  },
});
